/**
 * @author Rafal Cymbalsita
 * @class ProjectsStatus
 * @static
 * @property {String} status
 */
export default class ProjectStatus {
   /**
    * @constructor
    * @param {String} status
    */
   constructor(status) {
      this.status = status;
   }
   /**
    * @public
    * @returns {ProjectStatus}
    */
   getStatusDTO() {
      return {
         status: {
            status: this.status
         }
      };
   }
}
